◆立体ハートに
誕生石が
揺れる。煌めく。<br><br>

立体的なハートの中に天使の卵が揺れる、大人気商品ダブルハートネックレス。
お好きな誕生石が選べるネック
レスとして登場しました。<br><br>


◆3通りのつけ方が楽しめる優秀ネックレス。<br><br>

ピンクシルバーのハートモチーフ単体で、上品に可愛く。

誕生石と天使の卵のモチーフ単体で、シンプルで可憐に。

ハートの中に誕生石と天使の卵を揺らして、エレガントに。

１つのネックレスを色々な洋服や気分に合わせて身に着けられます！<br><br>
限定品ならではの専用ボックスにてお届けいたします。<br><br>

