   <div class="present_txt"><p>当店は、人気アクセサリーブランド「天使の卵」や「未来天使」をはじめ、誕生石のペンダントやリングなど、プレゼントにピッタリなアクセサリーを取扱う通販ショップです。</p><br />
「優しい光につつまれる永遠の命」を表現したコンセプトジュエリー「未来天使」は未来に向けて輝ける命のすばらしさを多彩なテーマ・デザインで表現しています。<br />
