<p>
モチーフ全体にピンクシルバーを使用し、ハートの透かしを加えることで、キュートで大人っぽい印象の月モチーフに女性らしく温かい印象をプラスしました。横から見ると透かし部分が立体になっている、オシャレなデザインです。<br><br>

10金素材の星からは、誕生石が揺れるたびにキラキラ輝きます。
<br>
ご自身のお守りとして生まれた月の誕生石を入れるのも、また、お好きな誕生石をお選びいただき、大切な方へのプレゼントにもオススメの商品です。
<br><br>
